const { Link } = require("react-router-dom")

function Navlinks () {

    const Navrouter = [["Home", "#"], ["Blog", "#"], ["Portafolio", "#"],["About", "#"]]

    return(
        <div>
            <nav >
                {Navrouter.map(([title, url])=> (
                    <div>
                        <div>
                            <Link to={url}>
                                {title}
                            </Link>
                        </div>
                    </div>
                ))}
            </nav>
        </div>
    )
}

export default Navlinks;
